nown+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1594254596,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-37-changelog/"},{title="TSM 4.10: UI & Design",content="This is the second in a series of TSM 4.10 feature highlight blogs. Today we will be discussing the new User Interface and Designs in 4.10. This blog post is very GIF heavy to demonstrate the new functionality being discussed. Overall Look & Feel As we mentioned in an earlier teaser, one of the biggest [...]",timestamp=1593982610,link="https://blog.tradeskillmaster.com/tsm-4-10-ui-design/"},{title="TSM 4.10: New Sources",content="This is the first in a series of TSM 4.10 feature highlight blogs. Today we will introduce the new Price Sources and Value Sources, and new places you can use them in 4.10 Operation-Based Price Sources When you're setting up Auctioning Operations for example, you might have already set up a preferred maximum purchase price [...]",timestamp=1592932763,link="https://blog.tradeskillmaster.com/tsm-4-10-new-sources/"}}}]]) --<APP_INFO,Global,1596959770>
